import {
  RiLinkedinBoxLine,
  RiYoutubeLine,
  RiFacebookBoxLine,
  RiMailLine,
} from "react-icons/ri";
import { IoLogoInstagram } from "react-icons/io";
import { motion } from "framer-motion";

const aVariants = {
  hoverElement: { scale: 1.03, transition: { duration: 0.07 } },
};

const ContactMeComponent = () => {
  return (
    <SectionContainer id="contactMe_page">
      <SectionTitle> Where to find me? </SectionTitle>
      <SectionParagraf>
        {" "}
        You can find me on all these platforms and I am always willing to talk
        about anything!{" "}
      </SectionParagraf>
      <SocialMediaContainer>
        <motion.a
          whileHover={hover}
          variants={aVariants}
          className="nostyle_a"
          href="https://www.linkedin.com/in/josip-kuÅ¡tan-452189201/"
        >
          <RiLinkedinBoxLine />
        </motion.a>
        <motion.a
          whileHover={{ scale: 1.03, transition: { duration: 0.07 } }}
          className="nostyle_a"
          href="https://www.instagram.com/kukicrafts/"
        >
          <IoLogoInstagram />{" "}
        </motion.a>
        <motion.a
          whileHover={{ scale: 1.03, transition: { duration: 0.07 } }}
          className="nostyle_a"
          href="https://www.youtube.com/channel/UC_hjOP9OjeNMn4LlVr2u3oA"
        >
          <RiYoutubeLine />{" "}
        </motion.a>
        <motion.a
